var citiesByState = {
    Delhi: ["Moolchand Medcity","Fortis Hospital","SCI International Hospital"],
    Mumbai : ["Global Hospitals","Fortis Hospital","Wockhardt Hospitals","Kohinoor Hospital"],
    Kolkata : ["Ruby General Hospital","Calcutta Heart Clinic","AMRI Hospital"],
    Chennai : ["Dr. Mehta's Hospitals","Apollo Hospital","Sri Senthil Nursing Home","Venkataeswara Hospitals"]
}
function makeSubmenu(value) {
    if(value.length==0) document.getElementById("hospital").innerHTML = "<option></option>";
    else {
        var citiesOptions = "";
        for(cityId in citiesByState[value]) {
        citiesOptions+="<option>"+citiesByState[value][cityId]+"</option>";
        }
        document.getElementById("hospital").innerHTML = citiesOptions;
    }
}
function resetSelection() {
document.getElementById("city").selectedIndex = 0;
document.getElementById("hospital").selectedIndex = 0;
}
